import './App.css';
import HomePage from "./pages/homepage.js";
import logo from './lotus.png';


function App() {
  return (
    <div className="App">
      <div className="banner">
      <h1 className="banner-title">BetterBy.Science</h1>
      <button className="login-button">Log In</button>
      </div>
<HomePage />
    </div>
  );
}

export default App;
